IF OBJECT_ID(N'[__EFMigrationsHistory]') IS NULL
BEGIN
    CREATE TABLE [__EFMigrationsHistory] (
        [MigrationId] nvarchar(150) NOT NULL,
        [ProductVersion] nvarchar(32) NOT NULL,
        CONSTRAINT [PK___EFMigrationsHistory] PRIMARY KEY ([MigrationId])
    );
END;

SET IMPLICIT_TRANSACTIONS OFF;
SET NOCOUNT ON;
UPDATE [SystemConfig] SET [BootstrapInProgress] = @p0, [UpdatedAtUtc] = @p1
OUTPUT INSERTED.[RowVersion]
WHERE [Id] = @p2 AND [RowVersion] = @p3;

SET IMPLICIT_TRANSACTIONS OFF;
SET NOCOUNT ON;
UPDATE [SystemConfig] SET [BootstrapInProgress] = @p0, [LastSyncUtc] = @p1, [State] = @p2, [UpdatedAtUtc] = @p3
OUTPUT INSERTED.[RowVersion]
WHERE [Id] = @p4 AND [RowVersion] = @p5;

IF SERVERPROPERTY('EngineEdition') <> 5
BEGIN
    ALTER DATABASE [PokeSync] SET READ_COMMITTED_SNAPSHOT ON;
END;

IF OBJECT_ID(N'[__EFMigrationsHistory]') IS NULL
BEGIN
    CREATE TABLE [__EFMigrationsHistory] (
        [MigrationId] nvarchar(150) NOT NULL,
        [ProductVersion] nvarchar(32) NOT NULL,
        CONSTRAINT [PK___EFMigrationsHistory] PRIMARY KEY ([MigrationId])
    );
END;

CREATE TABLE [ElementType] (
    [Id] int NOT NULL IDENTITY,
    [Name] nvarchar(50) NOT NULL,
    CONSTRAINT [PK_ElementType] PRIMARY KEY ([Id])
);

CREATE TABLE [Generation] (
    [Id] int NOT NULL IDENTITY,
    [Number] int NOT NULL,
    [Name] nvarchar(50) NOT NULL,
    CONSTRAINT [PK_Generation] PRIMARY KEY ([Id])
);

IF EXISTS (SELECT * FROM [sys].[identity_columns] WHERE [name] IN (N'Id', N'BootstrapInProgress', N'LastSyncError', N'LastSyncUtc', N'State', N'SyncInProgress') AND [object_id] = OBJECT_ID(N'[SystemConfig]'))
    SET IDENTITY_INSERT [SystemConfig] ON;
INSERT INTO [SystemConfig] ([Id], [BootstrapInProgress], [LastSyncError], [LastSyncUtc], [State], [SyncInProgress])
VALUES (1, CAST(0 AS bit), NULL, NULL, N'initializing', CAST(0 AS bit));
IF EXISTS (SELECT * FROM [sys].[identity_columns] WHERE [name] IN (N'Id', N'BootstrapInProgress', N'LastSyncError', N'LastSyncUtc', N'State', N'SyncInProgress') AND [object_id] = OBJECT_ID(N'[SystemConfig]'))
    SET IDENTITY_INSERT [SystemConfig] OFF;

SET IMPLICIT_TRANSACTIONS OFF;
SET NOCOUNT ON;
UPDATE [SystemConfig] SET [BootstrapInProgress] = @p0, [UpdatedAtUtc] = @p1
OUTPUT INSERTED.[RowVersion]
WHERE [Id] = @p2 AND [RowVersion] = @p3;

